import React , {Component} from "react";
import {BrowserRouter as Rounter , Route , Link} from "react-router-dom";

class GitTracker extends Component{
    render(){
        return(
            <div className="row">
                <div className="col-12">
                    <div>
                        <Route>
                            <button>Git Tracker</button>
                        </Route>
                    </div>
                </div>
            </div>
        );
    }
}

export default GitTracker;
